import React from "react";

const Formulario = () => {
  return (
    <div>
      <h2>Novo Usuario</h2>
      <h1>Criar Usuario</h1>

      <form>
        <div>
          <label htmlFor='title'>Titulo</label>
          <input id='title' name='title' type='text' />
        </div>
      </form>
    </div>
  );
};
export default Formulario;
